const faqList = [
    {
        question: "What is HackerRank?",
        answer: "HackerRank is a place where programmers from all over the world come together to solve problems in a wide range of Computer Science domains such as algorithms, machine learning, or artificial intelligence, as well as to practice different programming paradigms like functional programming."
    },
    {
        question: "How do I write my code?",
        answer: "Each challenge page has an online editor embedded in the page for you to write and test your code in. If you're more comfortable coding in your favorite IDE, you can always upload your code to the challenge page when you're done!"
    },
    {
        question: "What is a rated contest?",
        answer: "Rated contests affect your profile page ratings. You can also get different ratings for completing challenges in different domains, as well as earn medals when you perform well."
    }
]

export default faqList;
